import React from 'react';
import { AiTwotoneDelete, AiTwotoneEdit} from "react-icons/ai";

const List = ({Task}) => {
    console.log(Task)
    return (
        <article className='list'>
           <h4>{Task.title}</h4>
           <div className='container__btn'>
            <button type="" className='btn_icon edit'><AiTwotoneEdit/></button>
            <button type="" className='btn_icon delete'><AiTwotoneDelete/></button>
           </div> 
        </article>
    );
};

export default List;
